def nth_fibonacci(n):
    if n<=0:
        print("The input number should be positive.")
        return
    elif n==1:
        return 1
    elif n==2:
        return 1
    else:
        fib=[1,1]
        for i in range(2,n):
            fib.append(fib[i-1]+fib[i-2])
        return fib[n-1]
